  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Nebraska
  WPAs outlines accomplishments during the 1969 calendar year. The report begins by
  summarizing the weather conditions, habitat conditions, water conditions, and food
  and cover conditions during the year. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, mammals, and fish-
  is also covered. The development and maintenance section discusses physical developments,
  plantings, collections and receipts, vegetation control, and wildfires. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, hunting, fishing, violations,
  and safety. Items of interest, N-R forms, photographs, and newspaper articles are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
